(5, 'The Modern GraphQL Bootcamp (with Node.js and Apollo)', 'https://picsum.photos/seed/picsum/1024/576', 10, 'നിങ്ങളെ ഒരു നല്ല ഓഫീസ് അസിസ്റ്റന്റ് ആയി വളർത്തി എടുക്കാൻ സഹായിക്കുന്ന കോഴ്സ് ആണിത്. ഒരു തവണ രജിസ്റ്റർ ചെയ്യുന്ന തോടുകൂടി കൂടി എല്ലാകാലത്തേക്കും പഠിച്ച കാര്യങ്ങൾ ഞങ്ങൾ അപ്ഡേറ്റ് ചെയ്യാനുള്ള അവസരം ലഭിക്കുന്നു.', 'Learn how to build GraphQL applications using Node.js. Includes Prisma v1, authentication, Apollo Client, and more!', 5, 1, 1, 0, '2021-02-13 07:36:50', '2021-02-13 07:36:50');
